import React from 'react'
import Card from './Card'
import { CreateCardData } from '../data/CreateCardData.js'

const CardList = () => {

	const newArray = CreateCardData.map((card, i) => {
		return (
			<Card id={CreateCardData[i].id}
			question={CreateCardData[i].question}
			dataEntryId={CreateCardData[i].dataEntryId}
			buttonText={CreateCardData[i].buttonText}
			/>
			)
	});

	const newNewArray = newArray.filter((answered) => { 
		if (answered === false) {
			return;
		}
		else {
			return null;
		}
	} );

	console.log(newNewArray);

	return(

		<div>

			{newNewArray}

		</div>
	)

}

export default CardList
